import React from 'react'

const Navbar = () => {
  return (
    <div className='navBar'>

      <div className="carts">
        <img src="../images/icon-cart.svg" alt="" />
        <img src="../images/image-avatar.png" alt="" />
      </div>
    </div>
  )
}

export default Navbar
